import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
    return (
        <div>
            <Navigation />
            <h1>Groupomania</h1>
            <div className='index_logo'><img src='frontend/src/assets/icone-above-font.png' 
            alt='logo'></img></div>
        </div>
    );
};

export default Home;
